}}) => {
  return (
    <div class="profile-about bg-light p-2">
    <Fragment>
    <h1>Friends</h1>

      {friends === null ? (<p>Damn!</p>):(
        friends.map(friend => (<div key={friend._id}>
          {friend.name}
          </div>)
      ))}
    </Fragment>

    </div>
  )
}


